import React, { useState } from 'react';
import styled from 'styled-components';
import { Button, Col, Container, Form, Row } from 'react-bootstrap';
import LogoIcon from '../../component/logo';

const Wrapper = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  min-height: 100vh;
`;
const Logo = styled(LogoIcon)`
   width: 200px;
  margin-bottom: 20px;
`;
const Title = styled.h3`
  margin-bottom: 40px;
`;
const FormContainer = styled(Container)`
  &[disabled] {
    opacity: 0.4;
  }
`;

const InstallMessageContainer = styled.div`
  position: fixed;
  top: 0;
  left: 0;
  display: flex;
  align-items: center;
  justify-content: center;
  width: 100%;
  height: 100vh;
  background: rgba(0, 0, 0, 0.4);
  z-index: 1031;
  text-align: center;
  overflow-y: auto;
  -webkit-overflow-scrolling: touch;
`;
const InstallMessage = styled.div`
  visibility: visible;
  -webkit-animation: install-message-fadein 1.5s;
  animation: install-message-fadein 1.5s;

  position: relative;
  padding: 2rem 2rem 0 2rem;
  border-radius: 0.3rem;
  margin: auto;
  background: #fff;
  width: 90%;
  max-width: 400px;
`;
const InstallMessageIcon = styled.img`
  width: 80%;
  margin-bottom: 1.4rem;
`;
const InstallMessageText = styled.div`
  font-size: 1em;
`;
const InstallMessageTitle = styled.h2`
  font-size: 1.4em;
  color: #323C46;
  margin-bottom: 1.8rem;
`;
const InstallMessageValue = styled.p`
  font-size: 0.7em;
`;
const InstallMessageClose = styled.a`
  position: absolute;
  top: -2.5rem;
  right: .2rem;
  font-size: 1.6em;
  color: #fff;
  cursor: pointer;

  &:hover {
    text-decoration: none;
    color: #fff;
  }
`;

export default function Login({ signIn, settings }) {
  const [username, setUsername] = useState(settings.users[0]);
  const [count, setCount] = useState(settings.counts[0]);
  const [showInstallMessage, setShowInstallMessage] = useState((('standalone' in window.navigator) && !(window.navigator.standalone)));

  function closeInstallMessage() {
    setShowInstallMessage({ showInstallMessage: false });
  }

  async function logIn() {
    signIn(username, count)
  }

  return (
    <Wrapper>
      <Row>
        <Logo />
        <Title>Lançar Inventário</Title>
        <FormContainer>
          <Form onSubmit={(e) => { e.preventDefault(); logIn(); }}>
            <Row>
              <Col>
                <Form.Group className="mb-3">
                  <Form.Label>Usuário</Form.Label>
                  <Form.Select size="lg" value={username} onChange={(e) => setUsername(e.target.value)}>
                    {settings.users.map((op, i) =>
                      <option key={`op-${i}`} value={op}>{op}</option>
                    )}
                  </Form.Select>
                </Form.Group>
              </Col>
            </Row>
            <Row>
              <Col>
                <Form.Group className="mb-3">
                  <Form.Label>Contagem</Form.Label>
                  <Form.Select size="lg" value={count} onChange={(e) => setCount(e.target.value)}>
                    {settings.counts.map((op, i) =>
                      <option key={`op-${i}`} value={op}>{op}</option>
                    )}
                  </Form.Select>
                </Form.Group>
              </Col>
            </Row>
            <Row>
              <Col>
                <div className="d-grid gap-2">
                  <br />
                  <Button variant="custom" type="submit" size="lg">
                    Entrar
                  </Button>
                </div>
              </Col>
            </Row>
          </Form>
        </FormContainer>
      </Row>
      {showInstallMessage &&
        <InstallMessageContainer>
          <InstallMessage>
            <InstallMessageClose className="fas fa-times" onClick={closeInstallMessage}>
              <strong>&times;</strong>
            </InstallMessageClose>
            <InstallMessageText>                               
              <InstallMessageIcon src="data:image/png;base64," />
              <InstallMessageTitle>
                Instale bun inventário.
              </InstallMessageTitle>
              <InstallMessageValue>
                Adicione o App à sua tela de início
              </InstallMessageValue>
            </InstallMessageText>
          </InstallMessage>
        </InstallMessageContainer>
        }
    </Wrapper>
  )
}
